Verenigde Staten
Drama / Misdaad
93 minuten

goeie film

met Helen Mirren, Cuba Gooding Jr. en Vanessa Ferlito

Rose en haar stiefzoon Mikey zijn huurmoordenaars. Niet alleen delen ze hun beroep, maar tevens hebben ze een romantische relatie.
Dan blijkt dat Rose een terminale vorm van kanker heeft en samen met haar stiefzoon besluit ze om samen nog een laatste opdracht 
aan te nemen.:
